  \"2013-03-15T23:08:10.745422\",\n\t\"name\": \"descriptions-of-virginia-caves-1975\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Bulletin on select caves throughout the
  state of Virginia. A total of 2,319 natural caves have been recorded from Virginia;
  and all but 10 of them are west of the Blue Ridge mountains. The limestone or solution
  caves are in the. western and southwestern parts of the state in carbonate rocks
  ranging in age from Lower Cambrian to Upper Mississippian. These caves are located
  in the Valley and Ridge and Appalachian Plateaus physiographic provinces, but the
  majority are in the former province.\",\n\t\"license_title\": null,\n\t\"extras\":
